import { Outlet } from "react-router-dom";
import MainNavigaion from "../layouts/MainNavigaion";

// styles
import rootstyle from "./RootPage.module.css";

function RootPage() {
  return (
    <>
      <MainNavigaion />
      <main className={rootstyle.content_conteiner}>
        <Outlet />
      </main>
    </>
  );
}
export default RootPage;
